-- ****************** ELIMINACION DETABLAS *****************
DROP TABLE editorial CASCADE CONSTRAINTS;
DROP TABLE escuela CASCADE CONSTRAINTS;
DROP TABLE carrera CASCADE CONSTRAINTS;
DROP TABLE empleado CASCADE CONSTRAINTS;
DROP TABLE estado_civil CASCADE CONSTRAINTS;
DROP TABLE escolaridad_emp CASCADE CONSTRAINTS;
DROP TABLE alumno CASCADE CONSTRAINTS;
DROP TABLE titulo CASCADE CONSTRAINTS;
DROP TABLE autor CASCADE CONSTRAINTS;
DROP TABLE ejemplar CASCADE CONSTRAINTS;
DROP TABLE prestamo CASCADE CONSTRAINTS;
DROP TABLE PORC_BENEF_ANNOS CASCADE CONSTRAINTS;

-- ****************** CREACION DE TABLAS *****************
CREATE TABLE AUTOR(
  tituloid       NUMBER (5) NOT NULL,
  autorid        NUMBER (3) NOT NULL,
  nombre         VARCHAR2 (40) NOT NULL,
  apellidos      VARCHAR2 (40));
ALTER TABLE AUTOR ADD CONSTRAINT PK_AUTOR PRIMARY KEY (tituloid,autorid);

CREATE TABLE CARRERA(
  carreraid   NUMBER (3) NOT NULL,
  descripcion VARCHAR2 (50) NOT NULL,
  escuelaid   NUMBER (3) NOT NULL);
ALTER TABLE CARRERA ADD CONSTRAINT PK_CARRERA PRIMARY KEY (carreraid);

CREATE TABLE EDITORIAL(
  editorialid NUMBER (3) NOT NULL,
  descripcion VARCHAR2 (30) NOT NULL);
ALTER TABLE EDITORIAL ADD CONSTRAINT PK_EDITORIAL PRIMARY KEY (editorialid);

CREATE TABLE EJEMPLAR(
  tituloid   NUMBER (5) NOT NULL,
  ejemplarid VARCHAR2 (4) NOT NULL,
  ISBN       VARCHAR2 (20) NOT NULL);
ALTER TABLE EJEMPLAR ADD CONSTRAINT PK_EJEMPLAR PRIMARY KEY (ejemplarid,tituloid);

CREATE TABLE estado_civil
(id_estcivil   NUMBER(1) NOT NULL,
 desc_estcivil    Varchar2(25) NOT NULL);
ALTER TABLE ESTADO_CIVIL ADD CONSTRAINT PK_ESTADO_CIVIL PRIMARY KEY(id_estcivil);

CREATE TABLE escolaridad_emp
(id_escolaridad  NUMBER(2) NOT NULL,
 sigla_escolaridad  VARCHAR2(6) NOT NULL,
 desc_escolaridad VARCHAR2(50) NOT NULL);
ALTER TABLE ESCOLARIDAD_EMP ADD CONSTRAINT PK_ESCOLARIDAD PRIMARY KEY (id_escolaridad);

CREATE TABLE EMPLEADO(
  run_emp    NUMBER (10) NOT NULL,
  dv_run         VARCHAR2(1) NOT NULL,
  nombre         VARCHAR2 (20) NOT NULL,
  apaterno       VARCHAR2 (20) NOT NULL,
  amaterno       VARCHAR2 (20) NOT NULL,
  fecha_contrato DATE NOT NULL,
  salario        NUMBER (8) NOT NULL,
  run_jefe         NUMBER (10),
  id_estcivil   NUMBER(1) NOT NULL,
  id_escolaridad  NUMBER(2) NOT NULL);
ALTER TABLE EMPLEADO ADD CONSTRAINT PK_EMPLEADO PRIMARY KEY (run_emp);

CREATE TABLE ESCUELA(
  escuelaid   NUMBER (3) NOT NULL,
  descripcion VARCHAR2 (30) NOT NULL);
ALTER TABLE ESCUELA ADD CONSTRAINT PK_ESCUELA PRIMARY KEY (escuelaid);

CREATE TABLE alumno(
  alumnoid     NUMBER (3) NOT NULL,
  nombre           VARCHAR2 (20) NOT NULL,
  apaterno         VARCHAR2 (20) NOT NULL,
  amaterno         VARCHAR2 (20) NOT NULL,
  genero           VARCHAR2 (1),
  fecha_nacimiento DATE,
  carreraid        NUMBER (3) NOT NULL);
ALTER TABLE alumno ADD CONSTRAINT PK_ALUMNO PRIMARY KEY (alumnoid);

CREATE TABLE PRESTAMO(
  prestamoid    NUMBER (10) NOT NULL,
  fecha_ini_prestamo  DATE NOT NULL,
  hora_ini_prestamo   VARCHAR2 (5) NOT NULL,
  fecha_ter_prestamo DATE NOT NULL,
  hora_ter_prestamo  VARCHAR2 (5) NOT NULL,
  fecha_devolucion DATE,
  hora_devolucion  VARCHAR2 (5),
  multa         NUMBER (6),
  glosa_multa   VARCHAR2(100),
  tituloid      NUMBER (5) NOT NULL,
  ejemplarid    VARCHAR2 (4) NOT NULL,
  alumnoid  NUMBER (3) NOT NULL,
  run_emp    NUMBER (10) NOT NULL);
ALTER TABLE PRESTAMO ADD CONSTRAINT PK_PRESTAMO PRIMARY KEY (prestamoid);

CREATE TABLE TITULO(
  tituloid    NUMBER (5) NOT NULL,
  titulo      VARCHAR2 (70) NOT NULL,
  publicacion NUMBER (4) NOT NULL,
  paginas     NUMBER (4) NOT NULL,
  precio      NUMBER (6),
  editorialid NUMBER (3));
ALTER TABLE TITULO ADD CONSTRAINT PK_TITULO PRIMARY KEY (tituloid);

CREATE TABLE PORC_BENEF_ANNOS 
(anno_ini   NUMBER(2) NOT NULL,
 anno_ter   NUMBER(2) NOT NULL,
 porcentaje_beneficio NUMBER(4) NOT NULL); 
 ALTER TABLE PORC_BENEF_ANNOS ADD CONSTRAINT PK_PORC_BENEF_ANNOS PRIMARY KEY (anno_ini);

ALTER TABLE AUTOR ADD CONSTRAINT FK_AUTOR_TITULO FOREIGN KEY (tituloid) REFERENCES TITULO (tituloid);
ALTER TABLE CARRERA ADD CONSTRAINT FK_CARRERA_ESCUELA FOREIGN KEY (escuelaid) REFERENCES ESCUELA (escuelaid);
ALTER TABLE EJEMPLAR ADD CONSTRAINT FK_EJEMPLAR_TITULO FOREIGN KEY (tituloid) REFERENCES TITULO (tituloid);
ALTER TABLE EMPLEADO ADD CONSTRAINT FK_EMPLEADO_EMPLEADO FOREIGN KEY (run_jefe) REFERENCES EMPLEADO (run_emp);
ALTER TABLE EMPLEADO ADD CONSTRAINT FK_EMPLEADO_ESTCIVIL FOREIGN KEY(id_estcivil) REFERENCES estado_civil(id_estcivil);
ALTER TABLE EMPLEADO ADD CONSTRAINT FK_EMPLEADO_ESCOLARIDAD FOREIGN KEY(id_escolaridad) REFERENCES escolaridad_emp(id_escolaridad);
ALTER TABLE ALUMNO ADD CONSTRAINT FK_ALUMNO_CARRERA FOREIGN KEY (carreraid) REFERENCES CARRERA(carreraid);
ALTER TABLE PRESTAMO ADD CONSTRAINT FK_PRESTAMO_EJEMPLAR FOREIGN KEY(ejemplarid,tituloid) REFERENCES EJEMPLAR(ejemplarid,tituloid);
ALTER TABLE PRESTAMO ADD CONSTRAINT FK_PRESTAMO_EMPLEADO FOREIGN KEY(run_emp) REFERENCES EMPLEADO(run_emp);
ALTER TABLE PRESTAMO ADD CONSTRAINT FK_PRESTAMO_ALUMNO FOREIGN KEY(alumnoid) REFERENCES alumno(alumnoid);
ALTER TABLE TITULO ADD CONSTRAINT FK_TITULO_EDITORIAL FOREIGN KEY(editorialid) REFERENCES EDITORIAL(editorialid);

-- ****************** POBLADO DE TABLAS *****************




















COMMIT;